import asyncio
from motor.motor_asyncio import AsyncIOMotorClient
import certifi
import os
from dotenv import load_dotenv
import requests

# Load environment variables
load_dotenv()
MONGO_URI = os.getenv("MONGO_URI")
DB_NAME = "marketplace"
picture = ""

async def cleanup_listings():
    # Connect to MongoDB
    client = AsyncIOMotorClient(MONGO_URI, tlsCAFile=certifi.where())
    db = client[DB_NAME]
    listings_collection = db["listings"]

    result = await listings_collection.delete_many({})

    # Close connection
    client.close()


async def create_listings():
    # Connect to MongoDB
    client = AsyncIOMotorClient(MONGO_URI, tlsCAFile=certifi.where())
    db = client[DB_NAME]
    listings_collection = db["listings"]

    # login
    res = requests.post("http://127.0.0.1:8000/login", json={"email": "hello1@utoronto.ca", "password": "123"})
    token = res.json()["access_token"]
    headers = {"Authorization": f"Bearer {token}"}

    for i in range(20):
        data = {
                "title": f"post{i}",
                "price": f"{100 + i}",
                "description": f"yes {i}",
                "pictures": [f"{picture}"],
                "condition": "Used" if i % 2 == 0 else "New",
                "campus": "Mississauga" if i % 3 == 0 else "Scarborough",
        }
        requests.post("http://127.0.0.1:8000/listings", headers=headers, json=data)

    # Close connection
    client.close()


if __name__ == "__main__":
    asyncio.run(cleanup_listings())
    asyncio.run(create_listings())
